import { GET_ADMIN_ERROR, GET_ADMIN_PROCESS, GET_ADMIN_SUCCESS } from "../ACTIONS/admin";

const initialState = {
    admin:[],
    isloading:false,
    isError:null,
}

export const admin_reducer = (state = initialState, action) => {
    const data = action.data
    switch (action.type) {
        case GET_ADMIN_PROCESS:
            return{
                ...state
            }
        case GET_ADMIN_SUCCESS:
            return{
                admin: data,
                ...state
            }
        case GET_ADMIN_ERROR:
            return{
                ...state
            }
        default:
            return{
                admin:[{title:"Hello",author:"World"}]
            }
            break;
    }
}
